import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  entities: {},
  authUser: {},
};

export const authSlice = createSlice({
  name: "auth",
  initialState,
  reducers: {
    login: (state, action) => {
      const { email } = action.payload;
      console.log(email);

      return {
        ...state,
        authUser: state.entities[email]
      }
    },
  },
});

export const authSliceActions = authSlice.actions;
